// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract HealthDataSharing {

    // Define a struct to store IPFS hash and access permissions
    struct PatientData {
        string ipfsHash;
        address[] authorizedEntities;
    }

    // Mapping of patient address to their data on IPFS
    mapping(address => PatientData) private patientData;

    // Mapping to track entity authorization by patients
    mapping(address => mapping(address => bool)) public accessPermissions;

    // Events for tracking activities
    event DataStored(address indexed patient, string ipfsHash);
    event AccessGranted(address indexed patient, address indexed entity);
    event AccessRevoked(address indexed patient, address indexed entity);

    // Modifier to check that only the patient can modify their data or permissions
    modifier onlyPatient() {
        require(msg.sender == tx.origin, "Only the patient can modify permissions.");
        _;
    }

    // Store data IPFS hash on-chain and set initial permissions
    function storeData(string memory _ipfsHash) public onlyPatient {
        PatientData storage data = patientData[msg.sender];
        data.ipfsHash = _ipfsHash;

        emit DataStored(msg.sender, _ipfsHash);
    }

    // Grant access permission to a healthcare provider or other entity
    function grantAccess(address _entity) public onlyPatient {
        require(_entity != address(0), "Invalid entity address.");
        accessPermissions[msg.sender][_entity] = true;
        patientData[msg.sender].authorizedEntities.push(_entity);

        emit AccessGranted(msg.sender, _entity);
    }

    // Revoke access permission from a healthcare provider or other entity
    function revokeAccess(address _entity) public onlyPatient {
        require(accessPermissions[msg.sender][_entity], "Entity does not have access.");
        accessPermissions[msg.sender][_entity] = false;

        emit AccessRevoked(msg.sender, _entity);
    }

    // Retrieve IPFS hash if the caller is authorized
    function retrieveData(address _patient) public view returns (string memory) {
        require(accessPermissions[_patient][msg.sender], "Access denied. You are not authorized.");
        
        return patientData[_patient].ipfsHash;
    }

    // View list of authorized entities for a specific patient
    function getAuthorizedEntities(address _patient) public view returns (address[] memory) {
        require(msg.sender == _patient || accessPermissions[_patient][msg.sender], "Access denied.");
        return patientData[_patient].authorizedEntities;
    }
}
